import React from 'react';
function Registration(){
    return(
    <div>
         <input type="text" class="form-control" placeholder="First name" aria-label="First name"></input>
         <input type="text" class="form-control" placeholder="Last name" aria-label="Last name"></input>
         <input type="text" class="form-control" placeholder="Mother name" aria-label="Mother name"></input>
         <input type="text" class="form-control" placeholder="Father name" aria-label="Father name"></input>
         <input type="email" class="form-control" id="inputEmail4" placeholder="Email"></input>
         <input type="password" class="form-control" id="inputPassword4" placeholder="Password"></input>
         <label>Phone:</label>
         <input type="text" value="+91" size="2"></input>
         <input type="text" size="10"></input>
    </div>
    );
}
export default Registration;
